import Header from "./components/Header";
import withDashboardContext from "./hoc/withDashboardContext";
import "./ActiveStudents.css";
import { Link } from "react-router-dom";

const ActiveStudents = () => {
  return (
    <div>
      <Header />
      <div
        style={{
          background: "rgb(204,204,204,.5)",
          height: "100vh",
        }}
      >
        <div
          style={{
            background: "white",
            height: "fit-content",
            padding: "3.5rem 1rem 7rem 1.5rem",
            width: "70%",
            margin: "0 auto",
          }}
        >
          <div
            style={{
              display: "flex",
              justifyContent: "space-between",
              alignItems: "center",
            }}
          >
            <button
              style={{
                borderRadius: "2px",
                padding: ".5rem 1rem",
                background: "#dc4d01",
              }}
            >
              Back
            </button>
            <span style={{ fontSize: ".9rem" }}>
              <Link to={"/dashboard"}>Home {">"}</Link>
              <span style={{ color: "grey" }}> All Active Users</span>
            </span>
          </div>
          <span>All Active Users</span>
          <table>
            <tr>
              <th>Action</th>
              <th>Name</th>
              <th>Email</th>
              <th>Access Code</th>
              <th>Registration Date</th>
              <th>Status</th>
            </tr>
            <tr>
              <td>Test</td>
              <td>Test</td>
              <td>Test</td>
              <td>Test</td>
              <td>Test</td>
              <td>Test</td>
            </tr>
          </table>
        </div>
      </div>
    </div>
  );
};

export default withDashboardContext(ActiveStudents);
